Here she comes now. The love of your life. This set shows the capability of a team and why we generally suggest having myself and my 2nd photographer cover your wedding ceremony. While I’m shooting film from the back in an artistic, fine art style to capture a dreamy, idealized story about the ceremony, Susan was shooting from the front on digital gear in a documentary style to quickly (digital is faster) capture the emotions and what it felt like to be there. This way you receive the best of both worlds: artistic film images that focus on beauty and serendipity, and equally artistic images that focus on realness and emotion. 

Much of the success of a wedding and these photos also comes down to styling and planning. If epic bridal portraits throughout the day are a priority, we highly suggest investing in hair and makeup, wardrobe, and photography. When you hire us, your investment equals experience, collaboration to fully understand the images you desire, and the time-tested knowledge to create them quickly and expertly. We are not leaving things to chance or hoping we get images you love. Your investment with us is peace of mind and confidence that you will receive images of depth, meaning, beauty, and emotion. 

🤍

