Cinematic moment at the end of the wedding night in the backseat of the getaway car. If you can’t exchange a knowing glance with your partner like this, don’t get married. Find that person you can silently communicate with from across any room. My husband/assistant, Brendan and I can do this. We have this specific look we give one another when we both say we won’t do something “bad,” (pub crawl on a school night, etc) but we know we are about to do it. 😆 We also have 3 secret handshakes we just naturally fell into. I dunno. Being your true self with another person who is also comfortable enough to be their truest self is such a huge part of a successful marriage because it is an important foundation of friendship. 🤍

